import "./_opening.scss";

const Opening = () => {
    return (
        <>
            <section className="opening">
                <div className="opening_container container">
                    <h1 className="opening_header_big">K</h1><h1 className="opening_header">rótko o mnie</h1>
                    <p>Swoją przygodę na zmechanizowanych dwoch kolach zacząlem w 2017r.
                        Zaczynałem od 125'tki Derbi Terra.
                        Po wyjezdzie tym malym motorkiem na Woodstock kolo  (~12h jazdy) poczulem czym jest turystyka motocyklowa i wiedzialem ze musze jak najszybicej musze zdobyc pelne prawko z kat A.
                        Tak tez sie stalo. </p>



                </div>
            </section>
        </>
    );
};

export default Opening;
